import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUserCircle } from '@fortawesome/free-solid-svg-icons';
import { FiShoppingBag } from 'react-icons/fi';
import React from 'react';
import IFoodLogo from '../../assets/IFoodLogo.svg';
import Carousel from '../../components/Carousel';
import './styles.css';
const HomePageClient: React.FC = () => {
    return(
        <>
            <section className="section-menu">
            <div className="menu-left-side">    
                <ul className="menu">
                    <li className="options-menu user-configs"><a href="#"><FontAwesomeIcon icon={faUserCircle} size="2x"/><p>Pedro Gustavo</p></a></li>
                </ul>
            </div>
            <div className="menu-right-side">
                <ul className="menu">
                    <li className="options-menu"><a href="#">Pagina Inicial</a></li>
                    <li className="options-menu"><a href="#">Sobre o sistema</a></li>
                    <li className="options-menu"><a href="#">Fazer um pedido</a></li>
                </ul>
            </div>
            </section>
            <section className="sub-header">
                <img src={IFoodLogo} alt="Ifood"/>
                <h1>Bem vindo, Pedro</h1>
                <div className="bag-div">
                    <div className="bag">
                        <a href="#"><FiShoppingBag size={40}/><p>Ir para a sacola</p></a>
                    </div>
                </div>
            </section>
            <Carousel/>
            <div className="img-menu"></div>
            <footer>

            </footer>



        </>
    );
}

export default HomePageClient;
